import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Compass, Heart, Zap, ShieldCheck } from 'lucide-react';

const About = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const pillars = [
    {
      icon: Compass,
      title: "Clarity & Vision",
      description: "Helping you rediscover your 'why' and mapping out a path to your authentic self."
    },
    {
      icon: Heart,
      title: "Emotional Intelligence",
      description: "Mastering your inner dialogue to foster self-love and healthier relationships."
    },
    {
      icon: Zap,
      title: "Actionable Growth",
      description: "Moving beyond theory into real-world habits that produce measurable life changes."
    },
    {
      icon: ShieldCheck,
      title: "Safe Space",
      description: "A non-judgmental environment where your vulnerability becomes your strength."
    }
  ];

  return (
    <section id="about" className="py-24 bg-[#080808] text-gray-100">
      <div className="container mx-auto px-4 md:px-6">
        <motion.div
          ref={ref}
          className="text-center mb-16"
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          <span className="text-orange-500 font-bold uppercase tracking-[0.2em] text-sm mb-4 block">My Philosophy</span>
          <h2 className="text-4xl md:text-6xl font-serif font-bold text-white mb-6">Empowering Your <span className="text-orange-500 italic">Evolution</span></h2>
          <p className="text-gray-400 max-w-2xl mx-auto text-lg font-light leading-relaxed">
            I don't just coach; I partner with you to bridge the gap between who you are and who you are destined to become.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-16 items-center">
          <motion.div
            className="space-y-8"
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ delay: 0.2, duration: 0.8 }}
          >
            <h3 className="text-3xl font-bold text-white leading-tight">Your transformation is my <span className="text-orange-500">priority.</span></h3>

            <p className="text-gray-400 leading-relaxed text-lg font-light">
              With a background in understanding human systems and a passion for personal development, I’ve dedicated my life to helping ambitious individuals break free from mental barriers.
            </p>

            <p className="text-gray-400 leading-relaxed text-lg font-light">
              I believe that everyone has a "Zone of Genius," but it’s often buried under societal expectations and limiting beliefs. My mission is to give you the tools, the strategy, and the emotional support to unearth that genius and live with absolute purpose.
            </p>

            <p className="text-gray-400 leading-relaxed text-lg font-light italic border-l-2 border-orange-500 pl-6">
              "True growth happens when we align our daily actions with our deepest values. I am here to help you find that alignment."
            </p>

            <div className="grid grid-cols-2 gap-6 pt-4">
              <div className="p-6 bg-white/5 rounded-2xl border border-white/10 text-center">
                <span className="block text-3xl font-bold text-orange-500 mb-1">50+</span>
                <span className="text-xs uppercase tracking-widest text-gray-400">Lives Impacted</span>
              </div>
              <div className="p-6 bg-white/5 rounded-2xl border border-white/10 text-center">
                <span className="block text-3xl font-bold text-orange-500 mb-1">500+</span>
                <span className="text-xs uppercase tracking-widest text-gray-400">Hours Coached</span>
              </div>
            </div>
          </motion.div>

          {/* Pillars Grid */}
          <motion.div
            className="grid grid-cols-1 md:grid-cols-2 gap-6"
            initial={{ opacity: 0, x: 50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ delay: 0.4, duration: 0.8 }}
          >
            {pillars.map((pillar, index) => (
              <motion.div
                key={index}
                className="p-8 bg-white/[0.03] border border-white/10 rounded-[32px] hover:border-orange-500/50 transition-all duration-500 group"
                initial={{ opacity: 0, y: 30 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ delay: 0.6 + index * 0.1, duration: 0.6 }}
                whileHover={{ y: -8 }}
              >
                <div className="w-14 h-14 bg-orange-500/10 rounded-2xl flex items-center justify-center text-orange-500 mb-6 group-hover:bg-orange-500 group-hover:text-white transition-all duration-300">
                  <pillar.icon size={28} />
                </div>
                <h4 className="text-xl font-bold text-white mb-3">{pillar.title}</h4>
                <p className="text-gray-400 text-sm leading-relaxed font-light">{pillar.description}</p>
              </motion.div>
            ))}
          </motion.div>
        </div>

        <motion.div
          className="mt-24 p-12 rounded-[40px] bg-gradient-to-b from-white/5 to-transparent border border-white/10 text-center"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ delay: 0.8, duration: 0.8 }}
        >
          <h3 className="text-2xl md:text-3xl font-bold text-white mb-6">Ready to Write Your New Chapter?</h3>
          <p className="text-gray-400 mb-10 max-w-2xl mx-auto font-light text-lg">
            Stop waiting for the "right time." The right time is created when you decide you're ready for more.
          </p>
          <motion.a
            href="#contact"
            className="inline-flex items-center justify-center px-12 py-4 bg-orange-500 text-white rounded-2xl font-bold hover:bg-orange-600 transition-all shadow-xl shadow-orange-500/20"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Start Your Journey
          </motion.a>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
